import { Image } from 'react-native';
import { Container, Header, View, DeckSwiper, Card, CardItem, Thumbnail, Text, Left, Body, Icon } from 'native-base';
import TextH from "./components/Text"

const cards = [
  {
    place: 'Oaxaca,Oaxaca',
    stars: '4.5',
    image: require('./img/image1.jpg'),
    text: 'lorem ipsum Lorem, ipsum dolor sit amet consectetur adipisicing elite '
  },

];
export default class SwipCards extends Component {
  render() {
    return (
      <Container style = {{background:'#E0E6EA'}}>
      <TextH/>
        <View>
          <DeckSwiper
            dataSource={cards}
            renderItem={item =>
              <Card style={{ elevation: 3 }}>
                 <CardItem cardBody>
          <Image
            source={item.image}
            style={{ height: 200, width: null, flex: 1 }}
          />
        </CardItem>
        <CardItem >
          <Body style = {{background:'#E0E6EA'}}>
            <Text style= {{color: '#4D5E73',}}>
              {item.text}
            </Text>
          </Body>
        </CardItem >
      <View style={{ 
          flexDirection: 'row',
        justifyContent: 'space-between'        
         }}>
         <Left>
            <Icon  style= {{color: '#4D5E73'}} active name="navigate" />
            <Text >{item.place}</Text>
            </Left>



            <Icon  style= {{color: '#4D5E73'}} active name="star" />
            <Text>
              {item.stars}
            </Text>

          </View >
      </Card>
            }
          />
        </View>
      </Container>
    );
  }
}
